class Solution:
    def shortestPalindrome(self, s):
        size=len(s)
        tmp=[a for a in s]
        tmp.reverse()
        tmp=''.join(tmp)
        if tmp==s:
            return s
        i=0
        for i in range(len(tmp)):
            if s[:size-i]==tmp[i:]:
                break
        return tmp[0:i]+s

s=Solution()
test=[
{"input":"", "output":2},

]
for t in test:
    r=s.shortestPalindrome(t['input'])
    if r!=t['output']:
        print("error:"+str(t)+" out:"+str(r))
